import React from "react";
import { Link, useNavigate } from "react-router-dom";

const AdminNavbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("adminToken");
    navigate("/admin/login");
  };

  return (
    <nav className="w-full bg-green-700 text-white shadow-md px-6 py-4 flex items-center justify-between">
      <div className="flex items-center space-x-6">
        <Link to="/admin/dashboard" className="font-bold text-lg">
          Dashboard
        </Link>
        <Link to="/admin/courses" className="hover:underline">
          Courses
        </Link>
        <Link to="/admin/lectures" className="hover:underline">
          Lectures
        </Link>
        <Link to="/admin/instructors" className="hover:underline">
          Instructors
        </Link>
      </div>
      <button
        onClick={handleLogout}
        className="bg-red-600 px-4 py-2 rounded hover:bg-red-700 transition"
      >
        Logout
      </button>
    </nav>
  );
};

export default AdminNavbar;
